var ItemData = new Array();
var CraftData = new Array();

function stealItemData()
{
	var $count = 1;
	forEach(ItemData, function (i) {
		document.write('insert into resource (id, name, fixedprice, category) values (' + $count++ + ',\'' + i[1] + '\',' + i[2] + ',\'' + i[0].toLowerCase() + '\');<br />')
	});
}

function stealCraftingData()
{
	document.write('array( <br />');
	forEach(CraftData, function (i) {
		document.write('array(')
		document.write('"category"=>"' + i[0].toLowerCase() + '",');
		document.write('"name"=>"' + i[1] + '",');
		document.write('"batch"=>' + i[2] + ',');
		document.write('"workload"=>' + i[3] + ',');
		document.write('"level"=>' + i[i.length - 1] + ',');
		document.write('"components"=>array(');
		var len = i.length;
		var resources = islice(i, 4, i.length - 1);
		try {
			var o = resources.next();;
			while (o)
			{
				document.write('"' + o + '"=>' + resources.next());
				o = resources.next();
				if(o)
					document.write(",");
			}
		} catch (e) {
		    if (e != StopIteration) {
		        throw e;
		    }
		    // pass
		}

		document.write(')');
		document.write('),<br />');
	});
	document.write(');<br />');
}
